import React from "react";
import { HiShoppingCart } from "react-icons/hi";


function Navbar({TotalCountchange}){
  return ( 
    <div className='py-4 bg-white'>
    <div className='max-w-6xl flex justify-between items-centre mx-auto'>
    <img className="h-16" src="data:image/png;base64,"/>
<div className="flex flex-col items-center" >

<HiShoppingCart className="text-4xl text-pink-500"/>
<span className="-m-10" >{TotalCountchange}</span>
</div>
    </div>
    
    </div>
    )
}

export default Navbar;
